import { Route, Routes, BrowserRouter, Redirect } from 'react-router-dom';

import {App} from "./App";
import {CarListPage} from "./pages/CarListPage/CarListPage";

export const RoutesHandler = () => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" />
                <Route path="/list" element={<CarListPage/>} />
            </Routes>
        </BrowserRouter>
    );
};
